message:
Esta condição não natural das pupilas de uma pessoa é chamada de "anisocoria" As causas do aparecimento da patologia podem ser diferentes: uso de vários medicamentos e drogas, bem como intoxicação, doenças e lesões oculares, cirurgia ocular, distúrbios neurológicos.

